webpackJsonp([0xf5ff684c0893],{"./node_modules/json-loader/index.js!./.cache/json/react-native-image-uploading.json":function(a,e){a.exports={data:{site:{siteMetadata:{title:"Tarcode",author:"Taariq Isaacs"}},markdownRemark:{id:"/Users/tarcode/Desktop/tarcode33/src/pages/2017-09-25-react-native-image-upload/index.md absPath of file >>> MarkdownRemark",html:'<p><img src="https://cloudinary-res.cloudinary.com/image/upload/c_fill,w_770/dpr_1.0/React_Progressive_Web_App_2000x1100.png" alt="React Native Cloudinary"></p>\n<p>Greetings creatures of the world. Today, weâ€™re gonna upload images to Cloudinary using React Native! ğŸ˜¬</p>\n<p>(â€œCloudinary is the image back-end for web and mobile developers. An end-to-end solution for all your image-related needs.â€ - <a href="https://cloudinary.com">The Cloudinary Website</a>)</p>\n<p>First you wanna make sure you have the React Native CLI installed (Weâ€™re not using create-react-native-app). Then, you wanna signup up to <a href="https://cloudinary.com">Cloudinary</a> if havenâ€™t already.</p>\n<p>Now letâ€™s get down to business.ğŸ¤“</p>\n<h2>Step 1</h2>\n<p><code>react-native init imageupload</code></p>\n<p><code>cd imageupload</code></p>\n<p><code>npm install</code></p>\n<p><code>mkdir app</code></p>\n<p><code>touch app/index.js</code></p>\n<h2>Step 2</h2>\n<p>Replace <code>index.android.js</code> and <code>index.ios.js</code> with the following:</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>import React from \'react\'\nimport { AppRegistry } from \'react-native\'\n\nimport App from \'./app/index\'\n\nAppRegistry.registerComponent(\'imageupload\', () => App)</code></pre>\n      </div>\n<h2>Step 3</h2>\n<p>Run <code>npm install â€”-save react-native-image-picker react-native-fetch-blob</code></p>\n<p>then <code>react-native link</code>.</p>\n<p>That should successfully install and link the packages required for accessing the file system (included with react-native-image-picker) and posting the image data to Cloudinary (react-native-fetch-blob).</p>\n<h2>Step 4</h2>\n<p>Before we can access files on the device, we have to ask the user for permission first. Follows these instructions to allow permissions for Android and iOS:</p>\n<h3>iOS</h3>\n<p>Add this to <code>ios/app_name/Info.plist</code>:</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/blog/static/105609704912481b400b0a534f358a07-68018.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 546px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 18.681318681318682%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="React Native Cloudinary"\n        title=""\n        src="/blog/static/105609704912481b400b0a534f358a07-1d5f7.png"\n        srcset="/blog/static/105609704912481b400b0a534f358a07-efee6.png 148w,\n/blog/static/105609704912481b400b0a534f358a07-7d4b6.png 295w,\n/blog/static/105609704912481b400b0a534f358a07-1d5f7.png 590w,\n/blog/static/105609704912481b400b0a534f358a07-3f9dd.png 885w,\n/blog/static/105609704912481b400b0a534f358a07-68018.png 1092w"\n        sizes="(max-width: 546px) 100vw, 546px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Android</h3>\n<p>Add this to <code>android/app/src/AndroidManifest.xml</code>:</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/blog/static/96f3bf33a9ab1ba8833124679830369a-64450.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 558px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 13.440860215053762%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABQAAAADCAYAAACTWi8uAAAACXBIWXMAABYlAAAWJQFJUiTwAAAAdElEQVQI161OQQ6DMAzrF9iBMYmONO1o00IR/P9vRonED3aw7NiWFTe8BvwTbvpMICLEFBE4wH89ODIoENIvGavPzMYK9bS/5tVu1QstGN8j3Oxn5JKx9x21VRtpW4OIoB8dRQqkimUPNNP+eZ2WqdZxfe4Gab9RCaMrBesAAAAASUVORK5CYII=\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="React Native Cloudinary"\n        title=""\n        src="/blog/static/96f3bf33a9ab1ba8833124679830369a-7bf6c.png"\n        srcset="/blog/static/96f3bf33a9ab1ba8833124679830369a-e5abb.png 148w,\n/blog/static/96f3bf33a9ab1ba8833124679830369a-4f8a5.png 295w,\n/blog/static/96f3bf33a9ab1ba8833124679830369a-7bf6c.png 590w,\n/blog/static/96f3bf33a9ab1ba8833124679830369a-007e4.png 885w,\n/blog/static/96f3bf33a9ab1ba8833124679830369a-64450.png 1116w"\n        sizes="(max-width: 558px) 100vw, 558px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h2>Step 5</h2>\n<p>This is the main component we use to do everything. </p>\n<p>Our imports:\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/blog/static/15b5f2c07965512596f7ddaf6be87af7-a677d.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 508px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 14.960629921259844%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="imports"\n        title=""\n        src="/blog/static/15b5f2c07965512596f7ddaf6be87af7-eca3c.png"\n        srcset="/blog/static/15b5f2c07965512596f7ddaf6be87af7-11fec.png 148w,\n/blog/static/15b5f2c07965512596f7ddaf6be87af7-4cd09.png 295w,\n/blog/static/15b5f2c07965512596f7ddaf6be87af7-eca3c.png 590w,\n/blog/static/15b5f2c07965512596f7ddaf6be87af7-e03ef.png 885w,\n/blog/static/15b5f2c07965512596f7ddaf6be87af7-a677d.png 1016w"\n        sizes="(max-width: 508px) 100vw, 508px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>The component class:\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/blog/static/0d617f18e3de654be461edb227ebb6e7-b9f3d.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 576px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 149.30555555555557%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="component"\n        title=""\n        src="/blog/static/0d617f18e3de654be461edb227ebb6e7-b468f.png"\n        srcset="/blog/static/0d617f18e3de654be461edb227ebb6e7-9d04d.png 148w,\n/blog/static/0d617f18e3de654be461edb227ebb6e7-f1dcb.png 295w,\n/blog/static/0d617f18e3de654be461edb227ebb6e7-b468f.png 590w,\n/blog/static/0d617f18e3de654be461edb227ebb6e7-d8a82.png 885w,\n/blog/static/0d617f18e3de654be461edb227ebb6e7-b9f3d.png 1152w"\n        sizes="(max-width: 576px) 100vw, 576px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>The upload method:\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/blog/static/545e70637fe2e9b719e09075ae534165-52082.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 15.420023014959725%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABQAAAADCAYAAACTWi8uAAAACXBIWXMAABYlAAAWJQFJUiTwAAAAfUlEQVQI133LTQ6CMBRGUfZg+1peI1IUibQUIonuf2VXdKZRB2fy/VSiQjsoodRIdrRnTxMdw6hv8npgvkfmWySVwDgpl6ykZf/KnroxUHn1aCdM63ZMNeW6jRelKR53ErQXdr1FW4eJFnMUTG2wzn5VSRCs2p+DT8aZv/0DuKZP4rcFZ2sAAAAASUVORK5CYII=\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="upload"\n        title=""\n        src="/blog/static/545e70637fe2e9b719e09075ae534165-fb8a0.png"\n        srcset="/blog/static/545e70637fe2e9b719e09075ae534165-1a291.png 148w,\n/blog/static/545e70637fe2e9b719e09075ae534165-2bc4a.png 295w,\n/blog/static/545e70637fe2e9b719e09075ae534165-fb8a0.png 590w,\n/blog/static/545e70637fe2e9b719e09075ae534165-526de.png 885w,\n/blog/static/545e70637fe2e9b719e09075ae534165-fa2eb.png 1180w,\n/blog/static/545e70637fe2e9b719e09075ae534165-52082.png 1738w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>The styles:\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/blog/static/8c19a6d9f67cd786b23188f87bbcd0ff-bcc90.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 268px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 120.89552238805969%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="styles"\n        title=""\n        src="/blog/static/8c19a6d9f67cd786b23188f87bbcd0ff-bcc90.png"\n        srcset="/blog/static/8c19a6d9f67cd786b23188f87bbcd0ff-f18b7.png 148w,\n/blog/static/8c19a6d9f67cd786b23188f87bbcd0ff-6a803.png 295w,\n/blog/static/8c19a6d9f67cd786b23188f87bbcd0ff-bcc90.png 536w"\n        sizes="(max-width: 268px) 100vw, 268px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h2>Step 6</h2>\n<p>Once thatâ€™s all done and dusted, run <code>react-native run-ios</code> or <code>react-native run-andoid</code> and upload your images to Cloudinary!!</p>\n<p><a href="https://github.com/TarCode/react-native-cloudinary">The code exists on Github too</a> </p>\n<h1>ğŸ‘½ ğŸ¤“ ğŸ‘¾</h1>',frontmatter:{title:"React Native Image Uploading with Cloudinary",date:"September 25, 2017"}}},pathContext:{path:"/react-native-image-uploading/"}}}});
